def compare_numbers(x1: int, p1: int, x2: int, p2: int) -> str:
    """
    Compare two numbers based on the given patterns.

    Args:
        x1 (int): The value of the first number.
        p1 (int): The number of trailing zeroes for the first number.
        x2 (int): The value of the second number.
        p2 (int): The number of trailing zeroes for the second number.

    Returns:
        str: The result of the comparison. '<' if x1 < x2, '>' if x1 > x2, '=' if x1 = x2.
    """
    num1 = x1 * 10**p1
    num2 = x2 * 10**p2
    if num1 < num2:
        return '<'
    elif num1 > num2:
        return '>'
    else:
        return '='

